import React from 'react'
import { data } from './components/Data';
import { Accordion } from 'react-bootstrap';
import { Accordian } from './components/Accordian';
const Faq = () => {
    const [data, setData] = useState(data);
    return (
        <>
            {data.map((curElem) => {
                const { id } = curElem;
                return <Accordian key={id} {...curElem} />
            })}
        </>   
    )
}

export default Faq
